import React from "react";
import ExpenseForm from "./ExpenseForm";
import "./NewExpense.css";

function NewExpense() {

    const getExpenseDataHandler = (expenseData) => {
        const myExpenseData = {
            ...expenseData,
            id: 2
        }
        console.log(myExpenseData);
    }

    return (
        <div className="new-expense">
            <ExpenseForm />
        </div>
    )
}

export default NewExpense;
